import React, { useState, useEffect } from 'react';
import { useCart } from '../../context/CartContext';
import { productAPI } from '../../services/api';
import CustomizationModal from '../../components/CustomizationModal';
import './ProductPages.css';

const ZodiacCoins = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedProduct, setSelectedProduct] = useState(null);
  const [showCustomizationModal, setShowCustomizationModal] = useState(false);
  const { addToCart } = useCart();

  // Fallback data with real database IDs and asset paths
  const fallbackCoins = [
    { id: 'b32fe619-bdf9-4382-8144-74735a59e164', name: 'Aries Zodiac Coin', symbol: '‚ôà', description: 'Collectible coin featuring Aries zodiac sign (Mar 21 - Apr 19)', price: 199, type: 'zodiac_coin', is_available: true },
    { id: '9f7ddcf5-426c-4fc6-8589-47c2604a9e1b', name: 'Taurus Zodiac Coin', symbol: '‚ôâ', description: 'Collectible coin featuring Taurus zodiac sign (Apr 20 - May 20)', price: 199, type: 'zodiac_coin', is_available: true },
    { id: 'ff7ef359-ab3d-4998-a3c4-73a3caad6a87', name: 'Gemini Zodiac Coin', symbol: '‚ôä', description: 'Collectible coin featuring Gemini zodiac sign (May 21 - Jun 20)', price: 199, type: 'zodiac_coin', is_available: true },
    { id: 'd15e5e6a-f7fd-4f68-8a55-e3daab87320a', name: 'Cancer Zodiac Coin', symbol: '‚ôã', description: 'Collectible coin featuring Cancer zodiac sign (Jun 21 - Jul 22)', price: 199, type: 'zodiac_coin', is_available: true },
    { id: 'd197f9df-c386-4e5e-9acf-dcb508d47603', name: 'Leo Zodiac Coin', symbol: '‚ôå', description: 'Collectible coin featuring Leo zodiac sign (Jul 23 - Aug 22)', price: 199, type: 'zodiac_coin', is_available: true },
    { id: 'a8288450-3f02-4dd5-ab72-38b25cbd33e4', name: 'Virgo Zodiac Coin', symbol: '‚ôç', description: 'Collectible coin featuring Virgo zodiac sign (Aug 23 - Sep 22)', price: 199, type: 'zodiac_coin', is_available: true },
    { id: '9f505a38-afad-4db0-8c3a-2368d63aafb7', name: 'Libra Zodiac Coin', symbol: '‚ôé', description: 'Collectible coin featuring Libra zodiac sign (Sep 23 - Oct 22)', price: 199, type: 'zodiac_coin', is_available: true },
    { id: 'f6a66874-fb7c-4faf-9513-46326580f7d7', name: 'Scorpio Zodiac Coin', symbol: '‚ôè', description: 'Collectible coin featuring Scorpio zodiac sign (Oct 23 - Nov 21)', price: 199, type: 'zodiac_coin', is_available: true },
    { id: '3ab0dd6f-bab7-4d09-9a92-81c4e1ef14c6', name: 'Sagittarius Zodiac Coin', symbol: '‚ôê', description: 'Collectible coin featuring Sagittarius zodiac sign (Nov 22 - Dec 21)', price: 199, type: 'zodiac_coin', is_available: true },
    { id: '789b7d67-16a5-4311-b57d-2ef1914f3b5b', name: 'Capricorn Zodiac Coin', symbol: '‚ôë', description: 'Collectible coin featuring Capricorn zodiac sign (Dec 22 - Jan 19)', price: 199, type: 'zodiac_coin', is_available: true },
    { id: '5aca3401-533c-4351-924e-e4a0bba124bc', name: 'Aquarius Zodiac Coin', symbol: '‚ôí', description: 'Collectible coin featuring Aquarius zodiac sign (Jan 20 - Feb 18)', price: 199, type: 'zodiac_coin', is_available: true },
    { id: 'f31ba02b-9c1c-4b5a-b81c-b592513a1372', name: 'Pisces Zodiac Coin', symbol: '‚ôì', description: 'Collectible coin featuring Pisces zodiac sign (Feb 19 - Mar 20)', price: 199, type: 'zodiac_coin', is_available: true }
  ];

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const response = await productAPI.getByType('zodiac_coin');
      console.log('Zodiac Coin API Response:', response); // Debug log

      // API returns array directly, not wrapped in products object
      const apiProducts = Array.isArray(response) ? response : [];

      // Map API products to include missing fields
      const mappedProducts = apiProducts.map(product => {
        const zodiacMap = {
          'aries_zodiac_coin': { display: 'Aries Zodiac Coin', symbol: '‚ôà', dates: 'Mar 21 - Apr 19' },
          'taurus_zodiac_coin': { display: 'Taurus Zodiac Coin', symbol: '‚ôâ', dates: 'Apr 20 - May 20' },
          'gemini_zodiac_coin': { display: 'Gemini Zodiac Coin', symbol: '‚ôä', dates: 'May 21 - Jun 20' },
          'cancer_zodiac_coin': { display: 'Cancer Zodiac Coin', symbol: '‚ôã', dates: 'Jun 21 - Jul 22' },
          'leo_zodiac_coin': { display: 'Leo Zodiac Coin', symbol: '‚ôå', dates: 'Jul 23 - Aug 22' },
          'virgo_zodiac_coin': { display:'Virgo Zodiac Coin', symbol: '‚ôç', dates: 'Aug 23 - Sep 22' },
          'libra_zodiac_coin': { display: 'Libra Zodiac Coin', symbol: '‚ôé', dates: 'Sep 23 - Oct 22' },
          'scorpio_zodiac_coin': { display: 'Scorpio Zodiac Coin', symbol: '‚ôè', dates: 'Oct 23 - Nov 21' },
          'sagittarius_zodiac_coin': { display: 'Sagittarius Zodiac Coin', symbol: '‚ôê', dates: 'Nov 22 - Dec 21' },
          'capricorn_zodiac_coin': { display: 'Capricorn Zodiac Coin', symbol: '‚ôë', dates: 'Dec 22 - Jan 19' },
          'aquarius_zodiac_coin': { display: 'Aquarius Zodiac Coin', symbol: '‚ôí', dates: 'Jan 20 - Feb 18' },
          'pisces_zodiac_coin': { display: 'Pisces Zodiac Coin', symbol: '‚ôì', dates: 'Feb 19 - Mar 20' }
        };

        const mapped = zodiacMap[product.name] || {
          display: product.name,
          symbol: '‚≠ê',
          dates: 'Zodiac dates'
        };

        return {
          id: product.name, // Use name as ID since it's the primary key
          name: mapped.display,
          symbol: mapped.symbol,
          price: Number(product.price),
          description: `Collectible coin featuring ${mapped.display.split(' ')[0]} zodiac sign (${mapped.dates})`,
          type: product.type,
          is_available: product.is_available,
          w_days: product.w_days ?? 5
        };
      });

      setProducts(mappedProducts);
    } catch (error) {
      console.error('Error fetching zodiac coins:', error);
      // Use fallback data if API fails
      setProducts(fallbackCoins);
    } finally {
      setLoading(false);
    }
  };

  const handleAddToCart = (product) => {
    setSelectedProduct(product);
    setShowCustomizationModal(true);
  };

  const handleCustomizedAddToCart = (product, quantity, customization) => {
    addToCart(product, quantity, customization);
    setShowCustomizationModal(false);
    setSelectedProduct(null);
  };

  const handleCloseModal = () => {
    setShowCustomizationModal(false);
    setSelectedProduct(null);
  };

  if (loading) {
    return (
      <div className="product-page">
        <div className="container">
          <div className="loading-spinner">Loading zodiac coins...</div>
        </div>
      </div>
    );
  }

  return (
    <div className="product-page">
